                                            | val GHC.Classes.== "DOCUMENT_PRINTED" -> BlanketPurchaseOrderStatus'EnumDOCUMENT_PRINTED
                                            | val GHC.Classes.== "NEW" -> BlanketPurchaseOrderStatus'EnumNEW
                                            | GHC.Base.otherwise -> BlanketPurchaseOrderStatus'Other val)
